import React from "react";

const ImageList = ({source}) =>{
    return(
        source.map((img,idx)=>{
            <div>
                {idx+1}
                <img src={img} alt={"img_"} key={"img_"}></img>
                
            </div>
        }
        )
    )
}
export default ImageList;
